Accounts_CustomFields_Description:
Devrait être un JSON valide où les clés sont les noms des champs contenant un dictionnaire de champs de paramétrage. Exemple :<br/><code>{
 "role": {
  "type": "select",
  "defaultValue": "student",
  "options": ["teacher", "student"],
  "required": true,
  "modifyRecordField": {
   "array": true,
   "field": "roles"
  }
 },
 "twitter": {
  "type": "text",
  "required": true,
  "minLength": 2,
  "maxLength": 10
 }
}</code>

Custom_Translations_Description:
Doit être un JSON valide où les clés sont des langues contenant un dictionnaire de clés et de traductions. Exemple : <br/><code>{
 "en": {
  "Channels": "Rooms"
 },
 "pt": {
  "Channels": "Salas"
 }
}</code>

SAML_Custom_user_data_fieldmap_descripti:
Configurez la façon dont les champs de compte d'utilisateur (comme l'e-mail) sont remplis à partir d'un enregistrement dans SAML (une fois trouvé).
Par exemple, `{"name":"cn", "email":"mail"}` choisira le nom lisible par l'homme d'une personne à partir de l'attribut cn, et son e-mail à partir de l'attribut mail.
Champs disponibles dans Rocket.Chat : `name`, `email` et `username`, tout le reste sera enregistré sous `customFields`.
Attribuez le nom d'un attribut immuable à la clé '__identifier__' pour l'utiliser comme identifiant utilisateur.
Vous pouvez également utiliser des expressions régulières et des modèles. Les modèles seront traités en premier, sauf lorsqu'ils référencent le résultat de l'expression régulière. 
```
{
  "email": "mail",
  "username": {
    "fieldName": "mail",
    "regex": "(.*)@.+$",
    "template": "user-__regex__"
  },
"name": {
   "fieldNames": [
      "firstName",
      "lastName"
    ],
    "template": "__firstName__ __lastName__"
  },
"__identifier__": "uid"
}```
